import React from "react";

class Login extends React.Component {
    constructor() {
        super()
        this.state = {
            users: [],
            username: "jeeva",
            password: "jeeva123"
        }
    }

    change = (event) => {
        event.preventDefault()
        alert(event)

        return (
            <div>
                <h2>Login Page</h2><br />
                <input type="text" name="username" id="username" value={this.state.username} /><br />
                <input type="text" name="password" id="password" value={this.state.password} /><br />
                <input type="submit" value="submit" onClick={ (event) => change(event)} />
            </div>
        )
    }
    render() {
        return(this.change)
    }
}

export default Login
